import React from "react";
import Homepro from "./Homepro";
import {Route, Switch} from "react-router-dom";
 
const Mainpro = () =>{
    return(
        <>
        <Switch>
            <Route path="/" component={Homepro}/>
            <Route path="/About" component={Aboutpro}/>
            <Route path="/Contact" component={Contactpro}/>
            <Route path="/Service" component={Servicepro}/>
           
        </Switch>
    
        </>


    );
};
export default Mainpro;
